INSERT INTO `data_exersice` VALUES (1,'Deadlift','Back',12,4,10,60,'Barbell','https://bsg-i.nbxc.com/product/87/20/f3/7edae7f67d2ea2820fcb62f919.jpg','เดดลิฟต์ (อังกฤษ: deadlift) คือการออกกำลังกายโดยใช้น้ำหนักโดยการถ่วงบาร์เบลล์หรือบาร์ ยกขึ้นเหนือพื้นในระดับสะโพก จากนั้นวางลงพื้น ถือเป็น 1 ใน 3 ของการยกน้ำหนัก ควบคู่ไปกับการสควอตและเบนช์เพรสส์','https://evofitness.at/wp-content/uploads/2019/03/EVO_Banner_March_14-1200x675.jpg',30,50),(2,'Dumbbell Row','Back',12,4,10,60,'Dumbbell','https://www.technogym.com/media/catalog/product/cache/1/image/602f0fa2c1f0d1ba5e241f914e856ff9/d/u/dumbbellsracks_freeweights_hero.jpg','เริ่มต้นเตรียมดัมเบล ยืนตัวตรง วางเท้าห่างกันประมาณหัวไหล่ ถือดัมเบลไว้ข้างลำตัวคว่ำมือทั้งสองข้างที่ถือดัมเบล แอ่นอก เอียงลำตัวไปข้างหน้า 45 องศา แนวกระดูกสันหลังเป็นแนวตรง ให้กล้ามเนื้อหลังถูกเหยียดจนสุด จากนั้นออกแรงเกร็งกล้ามเนื้อหลัง เพื่อดึงดัมเบลขึ้น แล้วลดดัมเบลลงช้าๆ เพื่อกลับสู่ท่าเตรียม','https://cdn2.coachmag.co.uk/sites/coachmag/files/2017/11/one-arm-dumbbell-row.jpg',30,40),(3,'Back Extension','Back',12,4,0,60,'Back Extension','https://cf.shopee.co.th/file/42c4d23064d99d35601ae7647815ed96','เริ่มต้นจากการนอนลงบนเบาะที่มีเบาะ โดยยันขาทั้งสองข้างติดพื้นใต้ที่ล็อกข้อเท้า ให้ลำตัวช่วงสะโพกวางเหนือเบาะเป็นแนวเส้นตรง ใช้มือทั้งสองข้างพาดไขว้ระหว่างอก จากนั้นค่อยๆลดลำตัวช่วงบนลงจนสุด จากนั้นค่อยๆออกแรงเกร็งกล้ามเนื้อหลังล่าง เพื่อยกลำตัวขึ้นดังเดิม ทำเช่นนี้จนครบ 10 -12 ครั้ง','https://cdn2.coachmag.co.uk/sites/coachmag/files/2019/06/back-hyperextension.jpg',30,50),(4,'Dumbbell Upright Row','Back',12,4,5,60,'Dunbbell','https://www.technogym.com/media/catalog/product/cache/1/image/602f0fa2c1f0d1ba5e241f914e856ff9/d/u/dumbbellsracks_freeweights_hero.jpg','ขั้นแรกใช้มือจับดัมเบลแบบคว่ำมือ ไว้บริเวณหน้าต้นขา ระยะแคบกว่าไหล่ งอข้อศอกเล็กน้อย ลำตัวตรง ยกดัมเบลขึ้นแทงศอกออกด้านข้างในแนวดิ่งแนบลำตัว โฟกัสที่กล้ามเนื้อหลังและบ่า ดึงขึ้นมาจนใกล้ปลายคาง ค้างไว้ 2 วินาที แล้วลดดัมเบลลงช้าๆ กลับทิศทางเดิมสู่ท่าเริ่มต้น จากนั้นทำซ้ำๆ จนครบ 10-12 ครั้ง','http://fullscalefit.com/wp-content/uploads/2017/09/17.2-Upright-Row-Execution-Full-Scale-Fitness-personal-trainer-in-akron-near-me-cleveland-sculpt-fit-body-toning-nutrition-1024x683.jpg',30,50),(5,'T-Bar Row','Back',12,4,10,60,'BarBell','https://bsg-i.nbxc.com/product/87/20/f3/7edae7f67d2ea2820fcb62f919.jpg','การฝึกด้วยท่า T-Bar Row เริ่มต้นจากการ ปักด้านปลายด้านใดด้านหนึ่งของบาร์เบลเข้าหามุมห้อง จากนั้นใช้ด้ามจับรูปตัว V มาคล้องไว้ด้านล่างของอีกฝั่งของบาร์เบล ยืนคร่อมบาร์เบล ตัวตรง เท้าทั้งสองข้างวางห่างกันประมาณหัวไหล่ คว่ำมือทั้งสองลงจับด้ามจับ ในลักษณะหันฝ่ามือเข้าหากัน แอ่นอก แล้วเอียงลำตัว มาทางด้านหน้าทำมุมประมาณ 45 องศา กับแนวพื้นโลก พร้อมกับหย่อนสะโพกออกไปทางด้านหลัง โดยให้รักษาแนวของกระดูกสันหลังให้เป็นแนวตรง ปล่อยแขนลงมาตามธรรมชาติ ให้กล้ามเนื้อหลังถูกเหยียดจนสุด เป็นท่าเตรียมฝึกท่า T-Bar Row','https://planforfit.com/wp-content/uploads/2015/06/t-bar-row-finish-1.jpg',30,40),(6,'Lat Pulldown','Back',12,4,10,60,'Machine','https://planforfit.com/wp-content/uploads/2016/09/v-grip-seated-row-finish.jpg','การฝึกด้วยท่า Wide-Grip Lat Pulldown เริ่มต้นจากการคว่ำมือทั้งสองข้างลง จับบาร์ด้วยความกว้างที่กว้างกว่าหัวไหล่ประมาณครึ่งศอก จากนั้นนั่งลงบนเบาะของเครื่อง Cable Pulldown พยายามล็อกขากับเบาะรองไว้ให้แน่น ปล่อยให้กล้ามเนื้อหลังถูกเหยียดออกจนสุด ไปตามแรงของเคเบิ้ล เป็นท่าเตรียมฝึกท่า Wide-Grip Lat Pulldown','https://planforfit.com/wp-content/uploads/2015/07/wide-grip-lat-pulldown-finish-resize1.jpg',30,40),(7,'Seated cable row','Back',12,4,10,60,'Machine','https://m.media-amazon.com/images/I/51OqWxXltmL._SL1190_.jpg','การฝึกด้วยท่า  Seated Row เริ่มต้นจากการนั่งลงบนเบาะ ใช้มือทั้งสองข้างจับด้ามจับ ในลักษณะหันฝ่ามือเข้าหากัน จากนั้นใช้เท้าถีบแป้น เพื่อดันลำตัวออกมา จนอยู่ในตำแหน่งที่ กล้ามเนื้อหลังถูกเหยียดตัวจนสุด นั่งหลังตรง แอ่นอก เป็นท่าเตรียมฝึกท่า  Seated Row','https://planforfit.com/wp-content/uploads/2016/09/v-grip-seated-row-finish.jpg',30,40),(8,'Decline Cable Flyes','Chest',12,4,5,60,'Cable','https://yorkbarbell.com/wp-content/uploads/2017/02/55017_Cable_Cross.jpg','การฝึกด้วยท่า Decline Bench Cable Flyes เริ่มต้นจากการตั้งเบาะนอนเอียงลง 45 องศา ไว้ตรงกลางของเคเบิ้ลทั้งสองข้าง  จากนั้นนอนลงบนเบาะ ปรับให้รอกให้อยู่ในตำแหน่งที่ต่ำที่สุด แล้วดึงเคเบิ้ลทั้งสองข้างขึ้นให้พาดมาทางด้านหน้าของลำตัว ในลักษณะหันฝ่ามือเข้าหากัน เหยียดแขนจนตึง แต่ว่าไม่ล็อกข้อศอก เป็นท่าเตรียมฝึกท่า Decline Cable Flyes','https://i.ytimg.com/vi/OPYrUGZL8nU/maxresdefault.jpg',30,40),(9,'Bench Press','Chest',12,4,5,60,'Barbbell','https://bsg-i.nbxc.com/product/87/20/f3/7edae7f67d2ea2820fcb62f919.jpg','หลังจากนอนบนเก้าอี้ออกกำลังเรียบร้อยแล้ว ให้หนุ่ม ๆ จับบาร์เบลที่ความกว้างระดับหัวไหล่ ยืดอกไว้ จากนั้นยกบาร์เบลลงมาโดยทิ้งข้อศอกให้ลงมาต่ำกว่าหัวไหล่เล็กน้อย โดยเวลาใช้แรงให้หายใจออก ผ่อนแรงหายใจเข้าทำควบคู่กันไป ขณะที่โฟกัสไปที่หน้าอกเป็นตัวดันบาร์เบลขึ้นมา จังหวะการเล่น (3-2-2-1) ทำ 10-15 ครั้งต่อเซต ทำทั้งหมด 3-4 เซต','http://www.tuvayanon.net/L-ep6-001001B-580809-2050-a02.jpg',30,40),(10,'Incline Dumbbell Bench Press','Chest',12,4,10,60,'Dumbbell','https://www.technogym.com/media/catalog/product/cache/1/image/602f0fa2c1f0d1ba5e241f914e856ff9/d/u/dumbbellsracks_freeweights_hero.jpg','การฝึกด้วยท่า Incline Dumbbell Bench Press เริ่มต้นจากการนอนหงายหน้าลงบนเบาะเอียงขึ้น 45 องศา จับดัมเบล โดยหันฝ่ามือออกไปทางด้านหน้าของลำตัว ดันขึ้นในลักษณะที่แขนตึง แต่ไม่ล็อกข้อศอก เป็นท่าเตรียมฝึกท่า Incline Dumbbell Bench Press','https://planforfit.com/wp-content/uploads/2015/07/incline-dumbbell-bench-press-finish-resize.jpg',30,40),(11,'Pec Deck','Chest',12,4,10,60,'Machine','https://www.ironcompany.com/media/mf_webp/jpg/media/catalog/product/cache/678f0f442fd72d9e0c1cda66621015b6/t/k/tko-achieve-duals-8802-pec-dec-rear-delt_1.webp','การฝึกด้วยท่า Pec Deck เริ่มต้นจากการนั่งลงบนเครื่อง Pec Deck โดยปรับเบาะให้สูง ในตำแหน่งที่เมื่อนั่งแล้ว ด้ามจับจะอยู่ในระดับเดียวกันกับหัวไหล่ จากนั้นจับด้ามจับทั้งสองข้างไว้ แล้วหมุนมาทางด้านหน้าของลำตัว ให้มือสัมผัสโดนกัน เป็นท่าเตรียมฝึกท่า Pec Deck','https://planforfit.com/wp-content/uploads/2015/07/pec-deck-flys-finish-1.jpg',30,40),(12,'Squat','Leg',12,4,10,60,'Barbbell','https://bsg-i.nbxc.com/product/87/20/f3/7edae7f67d2ea2820fcb62f919.jpg','ท่า Squat นั้นดีต่อสุขภาพข้อต่อและกล้ามเนื้อแถมยังเสริมความเร็วและท่วงท่าในการวิ่งให้ดีขึ้น ร่างกายส่วนล่างที่แข็งแรงจะเพิ่มพลังในการสับขาวิ่งให้กับเรา และช่วยป้องกันอาการบาดเจ็บได้ การฝึกท่า Squat จึงมีความสำคัญแถมยังเป็นท่าที่ฝึกได้ง่ายอีกด้วย แต่มันยังมีอีกหลายเรื่องเกี่ยวกับท่า Squat ที่เพื่อนๆควรรู้','https://img.kapook.com/u/thachapol/b9999999999999999999999/a278_1.jpg',30,40),(13,'Leg Press','Leg',12,4,20,60,'Machine Leg Press','https://yorkbarbell.com/wp-content/uploads/2017/01/55035_leg-press_main2_low.jpg','การฝึกด้วยท่า Leg Press เริ่มต้นจากการ นอนลงบนเบาะ วางเท้าทั้งสองข้างลงบนแป้นถีบ ด้วยความกว้างประมาณหัวไหล่ วางเท้าต่ำ จากนั้นถีบแป้นออกไป แล้วปลดตัวล็อกออก เป็นท่าเตรียมฝึกท่า Leg Press','https://planforfit.com/wp-content/uploads/2015/07/leg-press-start-resize1.jpg',30,50),(14,'Leg extension','Leg',12,4,10,60,'Machine Leg Extension','https://image.makewebeasy.net/makeweb/0/t01KydE3z/PinLoad/HLE200B_Pic1.jpg','การฝึกด้วยท่า Leg Extension เริ่มต้นจากการ นั่งลงบนเครื่อง โดยให้หลังและก้นนาบสนิทติดกับเบาะ สอดเท้าทั้งสองข้าง ล็อคเข้าไว้กับเบาะรอง มือทั้สองข้างกำด้ามจับเอาไว้ เพื่อไม่ให้ตัวลอยขึ้นจากเบาะ ระหว่างการฝึก เป็นท่าเตรียมฝึกท่า Leg Extension','https://i0.wp.com/thefitnessmaverick.com/wp-content/uploads/2020/11/leg-extensions-bad-scaled-e1605887329262.jpg?fit=1000%2C667&ssl=1',30,40),(15,'Lying Leg Curl','Leg',12,4,10,60,'Machine Lying Leg Curl','https://image.made-in-china.com/2f0j00sOMauZzjldpW/Lying-Leg-Curl.jpg','การฝึกด้วยท่า Pec Deck เริ่มต้นจากการนั่งลงบนเครื่อง Pec Deck โดยปรับเบาะให้สูง ในตำแหน่งที่เมื่อนั่งแล้ว ด้ามจับจะอยู่ในระดับเดียวกันกับหัวไหล่ จากนั้นจับด้ามจับทั้งสองข้างไว้ แล้วหมุนมาทางด้านหน้าของลำตัว ให้มือสัมผัสโดนกัน เป็นท่าเตรียมฝึกท่า Pec Deck','https://planforfit.com/wp-content/uploads/2015/07/lying-leg-curl-finish-resize-1-1.jpg',30,40),(16,'Barbell Standing Calf Raise','Leg',12,4,10,60,'Barbbell','https://bsg-i.nbxc.com/product/87/20/f3/7edae7f67d2ea2820fcb62f919.jpg','การฝึกด้วยท่า Smith Machine Decline Bench Press เริ่มต้นจากการนอนหงายหน้าลงบนเบาะเอียงลง 45 องศา ในเครื่อง Smith Machine เกี่ยวขาทั้งสองข้างล็อคกับเบาะรองไว้ หงายมือทั้งสองข้างขึ้น จับบาร์เบลด้วยความกว้างกว่าหัวไหล่เล็กน้อย จากนั้นหมุนบาร์เบลออกมาจากที่พัก ในลักษณะที่แขนตึง แต่ไม่ล็อกข้อศอก เป็นท่าเตรียมฝึกท่า Smith Machine Decline Bench Press','https://planforfit.com/wp-content/uploads/2015/07/barbell-standing-calf-raise-finish1.jpg',30,40),(17,'Push Press','Shoulder',12,4,5,60,'Barbbell','https://bsg-i.nbxc.com/product/87/20/f3/7edae7f67d2ea2820fcb62f919.jpg','ท่านี้สำหรับผู้เล่นหน้าใหม่ แนะนำให้เล่นจากอุปกรณ์ที่มีน้ำหนักน้อย ฝึกจนชินจะทำให้สามารถเล่นแบบบาร์ได้อย่างมีประสิทธิภาพ โดยให้ผู้เล่นจับบาร์ในระดับลำตัว แล้วค่อยๆยกบาร์ไปในระดับหัวไหล่ พักบริเวณพื้นที่อกบนเรียกว่า “จุดพัก” แล้วค่อยยกบาร์ไปเหนือศีรษะในระยะเวลาสั้นๆ จากนั้นลดตำแหน่งกลับไปยังตำแหน่งจุดพัก พื้นที่อกบนของคุณ และลงไปยังจุดเดิม ท่านี้ต้องจัดระยะระหว่างขาให้เหมาะสม','https://sites.google.com/site/weighttrainingss/_/rsrc/1428897561801/tha-brihar-hil-shoulder/barbell-shoulder-press-1.jpg',30,40),(18,'Dumbbell Lateral Raise','Shoulder',12,4,2,60,'Dumbbell','https://www.technogym.com/media/catalog/product/cache/1/image/602f0fa2c1f0d1ba5e241f914e856ff9/d/u/dumbbellsracks_freeweights_hero.jpg','ท่านี้คนส่วนใหญ่เรียกว่า “ท่าบิน”  ในโรงยิมหลายที่จะเล่นทางนี้กันเป็นส่วนใหญ่ สำหรับผู้เล่นหน้าใหม่ให้ฝึกจากน้ำหนักน้อยก่อน ซึ่งท่านี้เริ่มต้นจากการจัดระดับดัมเบลให้อยู่บริเวณตรงกลางลำตัวแล้วค่อยๆ ยกแขนขึ้นในระดับไหล่ งอศอกเล็กน้อยเพื่อทำการเปิดหน้าแขน แต่ต้องระวังสำหรับผู้เล่นหน้าใหม่ คือต้องให้แกนหลังหรือลำตัวนิ่ง (ห้ามใช้หลังช่วย) และ ใช้ข้อมือในการจับดัมเบล โดยข้อศอกและไหล่ ต้องขนาดกันอยู่ในระดับเดียวกันซึ่งเป็นสิ่งที่สำคัญมาก','https://planforfit.com/wp-content/uploads/2015/07/standing-dumbbell-side-lateral-finish.jpg',30,40),(19,'Seated Dumbbell Shoulder Press','Shoulder',12,4,5,60,'Dumbbell','https://www.technogym.com/media/catalog/product/cache/1/image/602f0fa2c1f0d1ba5e241f914e856ff9/d/u/dumbbellsracks_freeweights_hero.jpg','เป็นท่าที่ได้รับความนิยมสูงสุดในการจัดอันดับ เนื่องจากเป็นท่าแรกที่สามารถจัดแรงสมดุลในการเล่นท่าไหล่ได้ดีที่สุด โดยการใช้แกนกลางลำตัวในการยกน้ำหนัก สำหรับผู้เล่นหน้าใหม่ต้องเริ่มต้นตั้งแต่การวางดัมเบลไว้ตรงหน้าขา แล้วยกดัมเบลขึ้นบริเวณหัวไหล่เป็นจุดพัก แล้วค่อยยกดัมเบลขึ้นเหนือศีรษะ หลังจากนั้นให้เคลื่อนกลับตำแหน่งเดิม','https://cdn.muscleandstrength.com/sites/default/files/seated-dumbbell-press-1.jpg',30,40),(20,'Cable Rear Delt Fly','Shoulder',12,4,10,60,'Machine','https://www.ironcompany.com/media/mf_webp/jpg/media/catalog/product/cache/678f0f442fd72d9e0c1cda66621015b6/t/k/tko-achieve-duals-8802-pec-dec-rear-delt_1.webp','เป็นหนึ่งในท่าที่ได้รับความนิยมจากดารา Hollywood หลายคน ซึ่งเป็นใช้เคเบิลในการเล่นไหล่ โดยการให้ผู้เล่นยืนออกห่างไปจากบริเวณเคเบิล หลังจากนั้นดึงเคเบิล โดยให้สายเคเบิลอยู่ระดับ 45 องศา ข้อศอกและหัวไหล่ต้องขนานกัน แล้วค่อยๆคืนเคเบิลกลับ','https://cdn.muscleandstrength.com/sites/default/files/facepulls-on-rings.jpg',30,40),(22,'Preacher Curls','Biceps and Triceps',12,4,5,60,'Barbbell','https://s.yimg.com/aah/fitnessgiant/legend-preacher-curl-bench-3114-22.png','ท่าเล่นกล้ามแขน Preacher Curls เน้นอวัยวะส่วนกล้ามเนื้อต้นแขนด้านหน้า (Biceps) เริ่มเล่นด้วยการนั่งลงบนเบาะพรีชเชอร์ โดยให้ต้นแขนทั้งสองข้างวางบนเบาะ แล้วใช้มือข้างใดข้างหนึ่งถือ Dumbbell แล้วยกมือข้างที่ถือให้สูงขึ้น ให้ปลายแขนตั้งฉาก แล้วลด Dumbbell ลงจนข้อศอกเกือบเหยียดตรง ให้ทำสลับข้างเรื่อย ๆ จนครบกำหนด','https://fitstop24.com/media/reverse-grip-barbell-preacher-curl_2.jpg.300x250_q95_crop-%2C_filters-detail.jpg',30,40),(23,'Lying Triceps Extensions','Biceps and Triceps',12,4,5,60,'Dumbbell','https://www.technogym.com/media/catalog/product/cache/1/image/602f0fa2c1f0d1ba5e241f914e856ff9/d/u/dumbbellsracks_freeweights_hero.jpg','ท่าเล่นกล้ามแขน Lying Triceps Extensions เป็นท่าบริหารที่เหมาะสำหรับกล้ามเนื้อ triceps (กล้ามหลังแขน) เริ่มจากการใช้อุปกรณ์ Barbell แล้วนอนราบไปกับเบาะ ยก Barbell ขึ้นเหนือศีรษะจนแขนเหยียดตึง ใช้แขนท่อนล่างลดอุปกรณ์ลงไปทางด้านหลังของศีรษะ และทำซ้ำจนครบ','data:image/jpeg;base64,',30,40),(24,'Pushdowns','Biceps and Triceps',12,4,5,60,'Machine','https://www.ironcompany.com/media/mf_webp/jpg/media/catalog/product/cache/678f0f442fd72d9e0c1cda66621015b6/t/k/tko-achieve-duals-8802-pec-dec-rear-delt_1.webp','ท่าเล่นกล้ามแขน Pushdowns ให้ยืนตรงแล้วโน้มตัวไปข้างหน้า เท้าทั้งสองข้างวางห่างกันประมาณหัวไหล่ ใช้มือสองข้างจับบริเวณที่เชื่อมต่อกับสายเคเบิล (พยายามให้แขนอยู่แนบลำตัว) ออกแรงดึงสายเคเบิลลงมาในแนวดิ่ง จนสุดปลายแขน ใช้อวัยวะส่วนข้อศอกในการเคลื่อนไหว แล้วทำซ้ำให้ครบ','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR_lTN8bEoHcBdfsgHkjRQNyloXRDt4FlQSEw&usqp=CAU',30,40),(50,'วันพักผ่อน','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
